INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("プリンセスなプリンなの\nお店にあったいろんな食べもの\nを入れられるだけ入れてみたの\nどんな味なのか楽しみなの", "やばいですね☆なの！", "おいしすぎて食べ始めたら\n止まらない最高のプリンなの\n今のミヤコを止められるヤツは\n誰もいないの", 3, 100, "ペコリーヌのプリン", 1, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("いつもオマエのそばに寄りそう\nヤツのぷりんなの。ミヤコの\nワガママもやさしく受け入れて\nくれそうなの", "主さま、なの！", "なんだかすごくやさしい気持ち\nになる味なの…\nおはようからおやすみまで\nずっと一緒な味なの…", 3, 101, "コッコロのプリン", 2, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("ツンツンデレデレなヤツの\nプリンなの。砂糖とスパイスを\n混ぜてみたの。どんな味になる\nか楽しみなの", "ぶっ殺すぞ！なの！\n…デレデレはどこなの？", "いろんな味が一度で楽しめる\nプリンなの。ツンデレはプリン\nにするとおいしいの。ミヤコも\nツンデレを目指してみるの", 3, 102, "キャルのプリン", 3, 0, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("オマエと同じで、一度赤ちゃん\nみたいになったヤツのプリン\nなの。ヒンヤリ、プリンアイス\nにしてみたの", "おにーたん♪なの！", "あったかいところで食べる\nプリンアイスは最高なの～♪\n安心しすぎて昔の記憶のない\nミヤコも心が子どもになるの～", 3, 103, "シェフィのプリン", 4, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("イリヤを見てたら思いついた\nトマトジュースが隠し味の\nプリンなの。栄養満点なの", "ハーハッハッハ！\n世界征服なのじゃなのー！", "トマトで栄養補給も完璧なの\nどんどん力がみなぎってきて\n復活も夢じゃないの\nミヤコが復活したら…", 3, 104, "イリヤのプリン", 5, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("アカリのプリンなの。ヨリと\n同じくらいかわいく作って\nやったの。正直ミヤコは\nおいしければなんでもいいの", "お兄ちゃんのエッチ！　なの！", "見た目がかわいくてもミヤコは\n味にも厳しいの。あむっ…\nこ、これは…！なんだかすごく\n変な気分になってきたの…", 3, 105, "アカリのプリン", 6, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("かわいくつくらないとアカリが\n怒りそうだからヨリのプリンは\nかわいく作ったの。自信作なの", "えっと…その…あんたのこと…\nだ、大っ嫌いなのーー！", "んむぅ…これはなかなか感想が\n難しいプリンなの…率直に言い\nたいような…心のうちに秘めて\nおきたいような…", 3, 106, "ヨリのプリン", 7, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("シノブはいつもミヤコに\nやさしくしてくれるから\n丁寧に作ったの。ドクロ親父は\nいらないから作ってないの", "お父さん…\nいいかげんにしてなの！\nん？プリンの未来は…\n見えなかったの…", "このプリンを食べるとシノブが\nミヤコの中にいるみたいなの！\nシノブの力があれば未来の\nプリンを見放題なの！", 3, 107, "シノブのプリン", 8, 0, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("黒い鎧を脱がないヤツのプリン\nなの。固めのプリンを目指したら\nカチカチになりすぎたの", "インフェルノシールド！なの！", "固すぎてかじれないから丸吞み\nにしたの。なんだか体が硬く\nなった気がするの。みんなを\n守れる気がするの！", 3, 108, "ジュンのプリン", 9, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("オマエをいっつもからかってる\nヤツのプリンなの\nちょっぴり変わったスパイスで\nからかいを表現したの", "あなたといると調子が狂うな\n…なの\n翻弄してたのはオマエなの？", "口の中でスパイスがプチプチ\nはじけて新食感なの！\nプチプチがミヤコを\n翻弄するの！", 3, 109, "トモのプリン", 10, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("王宮騎士団にいるちっこいヤツ\nなの。ちっこいけどやるヤツ\nらしいから、濃いめの味付けに\nしてみたの", "タイガーヒーローボンバー！\nなの！", "ん～見かけによらず濃厚な\nパンチのある味わいが\n口いっぱいに広がるの！", 3, 110, "マツリのプリン", 11, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("なんかすごくクールなプリンなの\nなんかテンションも少し\n低そうなの。これ\n食べちゃっても大丈夫なの？", "ま、いいんじゃん？\nしらんけどなの", "クールな見た目なのにとっても\n優しい味なの！なんだか\n懐かしさを感じるの…", 3, 111, "クロエのプリン", 13, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("きれいにデコれたの！\nカラフルでおいしそうなの\nこれは期待できそうなの", "ぷりーん★なの！", "なんか変わった食感なの…\nちゃる…ちょる…ちぇる？\nちぇるってしてるの\nでもちぇるってなんなの？", 3, 112, "チエルのプリン", 14, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("見た目は完ぺきなの！\nこれをつくったやつは\nきっと天才なの！\n早く食べたいの！", "端的に換言すれば\n青春の味なの？", "味はなんか妙に\n甘酸っぱいの…\n食べたことない味なの\nこの味ってもしかして…", 3, 113, "ユニのプリン", 15, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("オマエから聞いた懐かしい\n味ってヤツを全部入れてみたの\nオマエ記憶がないのに懐かしい\nってどういうことなの？", "幼なじみはあんた…なの？", "ミヤコも幽霊になる前の記憶\nがないのに、なんだか懐かしい\n気持ちになってくるの…", 3, 114, "サレンのプリン", 16, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("たまたま会ったメイドに教えて\nもらった作り方なの。メイドは\nプリンも作れるはずなの。\nなのにこの不安は何なの…？", "ひゃああんなの～！", "おかしいの。このプリンを\n食べてから、３回も転んだの\nミヤコは幽霊だから転んだり\nしないの。なんでなの…？", 3, 115, "スズメのプリン", 17, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("怖がりな子どもが教えてくれた\n小さくてかわいいプリンなの　\n触ってないのにぷるぷる震える\n驚きのやわらかさなの", "サルキデバレヤ！なの！", "甘さのなかに少しのしょっぱさ\nクセになる味なの\nこのプリンはがんばればきっと\nいろんな美味しいになれるの", 3, 116, "クルミのプリン", 18, 0, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("くまのぬいぐるみを見ていたら\nひらめいたの。小さいけど\nしっかりした甘さの元気に\nなれるプリンなの！", "プリンフルスイングなの～！", "このプリン、食べるとなんだか\nお姉ちゃんになった気分に\nなるの。ピンチのプリンは\nミヤコが守ってやるの！", 3, 117, "アヤネのプリン", 19, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("マホマホ王国って国にいる\nお姫様のプリンなの\n魔物も虜にしちゃう\nすてきなプリンなの", "みらくるみやりん\nくるりんぱ～☆なの！", "メルヘンパワーがあふれてきて\nいまならミヤコにも魔法が\n使える気がするの！\nほな、いきまひょ～なの！", 3, 118, "マホのプリン", 20, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("カッコいいプリンを目指して\nワイルドなものをガンガン\n入れてみたの。きっと熱い\nプリンができるはずなの", "ウルフェンバイトなの！", "うおーん！ミヤコなんだか\n強くなった気がするの！\n困ったことがあればミヤコが\nまとめて面倒見てやるの！", 3, 119, "マコトのプリン", 21, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("どっかの国でよくとれる\nゴーヤーに似てるやつを\nいれてみたの！ちょっと\n苦いらしいけど…", "なんくるないさ～！なの！", "一口食べたら元気が\nあふれて止まらないの！\n気分がいいから、一曲\n踊りでも披露してやるの！", 3, 120, "カオリのプリン", 22, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("勘の鋭いやつが好きな食べ物を\nたくさん入れてみたの\n難しいこと考えるのにぴったり\nらしいけど、なんでなの？", "ふふん。簡単な推理なの", "むむむ…なるほどなの\n上質な糖分をふんだんに\n使うことで、脳をより活性化\nできるからなの！", 3, 121, "カスミのプリン", 23, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("搾りたての牛乳を\nたっぷり使ったプリンなの～\nマヒルに手伝ってもらって\nミヤコ直々に搾ってきたの！", "エリザベス～！なの～！", "ミルクがとっても濃厚で\nほっぺたが落ちちゃうの～♪\nこのプリンからは牧場の…\n自然の息吹を感じるの！", 3, 122, "マヒルのプリン", 24, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("マヒルからやさしいヤツだって\n聞いたの。やさしさを表現\nするために奥ゆかしい甘さに\n仕上げてみたの", "私の好きな本…読んで\nもらえたらうれしいです…\nなの", "ほのかな甘さでありながら\nしっかりとした主張も\n感じさせる\n味わい深いプリンなの", 3, 123, "シオリのプリン", 25, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("牧場にいるヤツらしいの\n牛とは違うらしいの\nもふもふ気持ちいいらしいから\n食感にこだわって作ったの", "もふもふにしてあげるなの！", "こ、これは…！口の中に入れた\n瞬間にふんわり溶けて\nなくなっちゃうの！\nその食感がやみつきなの！", 3, 124, "リマのプリン", 26, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("いっつも寝てるやつらしいの\nぐっすり眠れる薬草をたくさん\n入れてみたの。プリンとして\nおいしくなるかはわからないの", "めんどくさいな～なの…", "んむぅ…評価が難しい味なの…\nおいしいのはおいしいの…\nん～考えてたら…\n眠くなってきたの…", 3, 125, "リンのプリン", 27, 0, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("クレープ屋の真っ赤な人に\n教わったプリンなの\n作り方を丁寧に教えてくれて\nとっても優しい人だったの！", "プリンの権能を解放するの～！", "プ…プリンなのにクレープの味\nがするの。味もすごく普通なの\nでも…なんだかプリンの新しい\n扉を開けそうな気がするの…！", 3, 126, "ラビリスタのプリン", 28, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("お店に落ちてた謎のレシピの\nプリンなの。レシピの表紙には\n『お姉ちゃんの愛情たっぷり』\nって書いてあったの", "お姉ちゃんパワー全開！なの！", "とろける食感が絶品なの～♪\n食べるとなんだか幸せな\n気持ちになれるの…これが\n愛情ってやつなの？", 3, 127, "シズルのプリン", 29, 0, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("リノから作り方を教わったの！\nさすがクレープ屋で働いてる\nだけあって美味しそうなの！", "お兄ちゃん、プリンをよこすの！", "これで妹力？があがるらしいの。\n妹になればお兄ちゃんに\nプリンをたかり放題なの！\n最高なの～！", 3, 128, "リノのプリン", 30, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("プリンのレシピで悩んでたら\n通りすがりのおねーさんが\n一緒に考えてくれたプリンなの\nいいヤツもたまにはいるの～♪", "困った時はお互いさまさま！\nなの！", "食べたら元気が湧いてくるの\nだからプリンのレシピのお礼に\nミヤコも人助けを手伝って\nやったの。ミヤコはえらいの！", 3, 129, "ヒヨリのプリン", 31, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("ミヤコががんばって作った\nこだわりのプリンなの～\nプリンは癒しなの。だから優しい\n気持ちで丁寧に作ったの", "フラワリングヒールなの～♪", "はっ…思わずお花畑が見えたの\n身も心も包まれるような\nとっても優しい味がするの\nこれは…まさに癒しなの～♪", 3, 130, "ユイのプリン", 32, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("究極のプリンを作るため\nミヤコは厳しい修行をしたの…\nその結果あって完成した\nクールで完璧なプリンなの！", "スラッシュテンペスト！なの。", "確かに完璧なプリンなの\nでも究極のプリンと呼ぶには\nまだまだ修行が必要なの…\nプリン作りは奥が深いの…！", 3, 131, "レイのプリン", 33, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("豪華で高級な\nお嬢様プリンなの\n中には宝石みたいな\n大きいイチゴを入れるの！", "おーほっほほほ！なの！", "味にも素材にもこだわりが\nあるの。一流は妥協しないの\nもっと豪華に、もっとおいしく\nできるはず…", 3, 132, "アキノのプリン", 34, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("外はしっかり、中はふわとろの\nプリンにするの\n泡みたいなしゅわしゅわの\n生クリームも入れるの♪", "プリしゅわ最高～！なの！", "プリンは飲み物とも言うの\nぐいっていってみるの\n…ふわしゅわでとろけるの～！\n体に染みわたるの～", 3, 133, "ユカリのプリン", 35, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("餡子を入れて\nオーブンでこんがり焼くの\nたい…焼きプリンなの\n斬新なの！", "にゃにゃにゃ！なの！", "このプリンは焼きたてのうちに\n食べるのが一番なの…！\n熱いけどおいしくて\nうずうずしてきたの…！", 3, 134, "タマキのプリン", 36, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("栄養バランスを考えて\n木の実をたくさん入れるの\nあれこれ忙しいときでも\n頼りになるプリンなの！", "効率全開！なの！", "プリンはいつでも手軽に\n食べられるのも魅力なの\nこれは食べ応えもあるから一つ\n食べればいっぱい動けるの", 3, 135, "ミフユのプリン", 37, 0, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("エルフの森で子どもにもらった\n薬草を使って作ったの\nこんな優しい味のプリンは\n初めてなの…", "あらあら～なの～♪", "このプリンを食べてから\nいい子になった気がするの\n大好きなプリンを泣いてる子に\nあげたの。いい気分なの", 3, 136, "ミサトのプリン", 38, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("お昼寝でみた夢の中に\nでてきた不思議なプリンを\n作ってみたの。見てたらまた\n眠くなってきたの…", "スヤスヤ～…なの…", "あまいプリンが口の中で\nぽんぽん弾ける未知の味なの！\n今なら不思議な力で世界も\n救えそうなの！でも眠くなるの…", 3, 137, "ハツネのプリン", 39, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("お店のはしっこに一つだけ\n残ったおもちゃを見て思い\nついたの。他のプリンと一緒に\n置いておくと震えだすの", "ぼっちは卒業なの～！", "知らないうちにはしっこに\n隠れちゃってたの。食べたら\nミヤコ、シノブたちに会いに\nいきたくなってきたの", 3, 138, "アオイのプリン", 40, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("トップオブアイドルの\nプリンなの。キラキラした\nものを入れて、あつ～い\nオーブンで焼いてみたの", "リズムあげるのー！", "口の中に華やかな甘さが\n広がる…これがアイドルなの？\n急に歌って踊りたく\nなってきたの！", 3, 139, "ノゾミのプリン", 41, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("ミヤコにプリンをくれるすごく\nいいヤツのプリンなの\n精霊に呼びかけながら\n一生懸命かき混ぜたの", "風の加護を！なの！", "プリンの生地がとっても\nなめらかで最高の舌触りなの！\n精霊、ミヤコのプリンのために…", 3, 140, "チカのプリン", 42, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("歌って踊って衣装も作れるヤツ\nのプリンなの。このプリンは\nきれいに包装するの。プリンを\n最高の形で着飾らせるの", "騎士さんのために\nしたんじゃありません！なの！", "包装は食べるまでの手間が\n増えてめんどくさいの。でも\nそのめんどくささもプリンの\n味を引き立てるの", 3, 141, "ツムギのプリン", 43, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("プリンをくれないならどうでも\nいいヤツなの。でも横で\nいろいろ言ってきたから\nがんばって作ったの", "宴の始まりなの！", "んむっ！？\nく、口のなかでプリンの\nおいしさが大暴れなの！\n止まらないの！", 3, 142, "クリスティーナのプリン", 12, 0, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("大人な甘さ控えめのプリンを\n作るの。試しにお魚を入れて\nみるの。プリンの可能性は\n無限大なの！", "一刀両断、覚悟しな！なの！", "大人の味なの。今やミヤコは\nみんなの頼れる姐御なの！\n悪さするやつはミヤコが\n許さないの！", 3, 143, "ルカのプリン", 44, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("サイカワサイツヨな\n魔法のプリンなの\n中身をカラフルにするの～\n甘いプリンは頭が冴えるの！", "きゅぴーん！キタコレ！なの！", "一口食べる度に味が変わって\n魔法みたいなの！\nもしかして全部食べたら\nミヤコも魔法少女になれるの？", 3, 144, "ナナカのプリン", 45, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("小難しい言葉をささやきながら\n作ったら魔力あふれるプリンが\n爆誕したの！でも、不思議と\nイタイタしいのはなぜなの～？", "人呼んで、疾風のミヤコなの！", "一口食べたら謎の組織に\n狙われたり、前世の記憶が蘇る\n気がするの～設定盛りすぎなの\nミヤコは、ミヤコは…", 3, 145, "アンナのプリン", 46, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("甘酸っぱい赤い木の実を\n切り刻んで入れるの\n甘くてちょっぴり刺激的な\nヤンデレのプリンなの", "クスクス…クスクスクス…なの", "なんか普通のプリンよりも\nいい匂いがするの～…\nプリンのことがもっともっと\n好きになっちゃうの…", 3, 146, "エリコのプリン", 47, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("健康に気を遣うミヤコは\nプリンにお薬を入れてみたの～\nでもなんだか毒々しいから\n彩りにバラを添えてみたの～", "どんなプリンも\nミヤコの隻眼からは\n逃れられないの～！", "鼻に抜ける薬のにおいがアレ\nだけど大人っぽくて頭が\nよくなった気がするの。無性に\n実験したくてしかたないの", 3, 147, "ミツキのプリン", 48, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("小さいけどしっかりした\n軍人のプリンなの\nちょっと固めにして\n砂糖はいっぱい入れるの", "私は子どもではない！なの！", "ん～王道なプリンは\n甘くて安定したおいしさなの～\n思わず笑顔になっちゃうの\nにこにこなの～♪…はっ！", 3, 148, "モニカのプリン", 49, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("オーエド町で手に入れた素材と\nトーゴクに伝わる術をかけて\nプリンを作るの。シュババ！\n忍法隠し味の術なの！", "ショーグン！　ミヤコと一緒に\n天下統一するデースなの！", "このプリンを食べてから\n誰かにお仕えしなきゃ\nいけない気がするデースなの\nそれはショ、ショー…", 3, 149, "ニノンのプリン", 50, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("オマエが持ってきた手錠を\nヒントに作ったプリンなの\nプリンが動けないように\nカチカチに固めたの", "…ぐふふ、じゅるり～なの", "カチカチに固めたせいで食感が\nプリンのようで\nプリンじゃないの…でもこの\nもどかしさが癖になるの…", 3, 150, "クウカのプリン", 51, 0, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("とっても美しいプリンなの\n美しいものを手当たり次第\n入れたらすごいことになったの", "あぁ、ミヤコはなんて美しいの～", "味も美しい以外の感想が\n出てこないの。ていうかこれを\n食べたミヤコも美しいの！\n鏡、鏡はどこなの！", 3, 151, "ユキのプリン", 52, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("知らないうちにお菓子が売れた\n時に思いついたプリンなの。\n作り方もよく覚えてない…\nけど、きっとおいしいの！", "ジー…ってミヤコなにしてるの\nミヤコはストーカーじゃないの！", "うん、やっぱりおいしく…\nん？あそこにいるのは\nアイツなの。あれ？\n体が勝手にアイツの方に…", 3, 152, "アユミのプリン", 53, 0, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("イタズラ好きの手下と一緒に\n作ったプリンなの。見た目は\nかわいいけど、作り方は\n意外と複雑なの～", "にひひ…イタズラの時間なの！", "見た目通り甘々で優しい味なの\nでも、レシピを見たら裏面に\n別の作り方が書いてあるの。\nこれだと激辛プリンに…", 3, 153, "ミソギのプリン", 54, 0, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("素直でやさしい手下と一緒に\n動物のぬいぐるみをいっぱい\n並べて作ったの", "ぴょんぴょこぴょーん、なの♪", "ん～、ふわふわの甘々なの！\nなんだか楽しくなって\n心も体もるんたったしてくるの", 3, 154, "ミミのプリン", 55, 0, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("幽霊を怖がっている手下と\n一緒に作ったプリンなの。\n小さいクセにきっちりしてて\nとってもかわいいプリンなの", "へんたいふしんしゃさんなの！", "ひんやりしてて暑い日でも\nおいしく食べられそうなの！\nん？これを買いたい大人が\nいる？それって…", 3, 155, "キョウカのプリン", 56, 0, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("カリスマモデルなプリンなの\nモリモリにデコレーションして\nカリスマ感を演出したの", "ハート狙い撃ち！なの！", "見て食べて楽しめる新機軸の\nプリンなの。ミヤコは幽霊\nだけど自分の足でランウェイを\n歩きたくなってきたの！", 3, 156, "スズナのプリン", 57, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("学校の先生をしてるヤツの\nプリンなの。お堅くしようと\nしたら、いつの間にか色っぽく\nなっちゃったの。なんでなの？", "授業を始めます♪なの！", "プ、プリンは全部ミヤコのもの\nなのに、なんだかこのプリンは\nいろんな人に教えたく\nなっちゃう不思議な味なの！", 3, 157, "イオのプリン", 58, 0, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("少し背伸びしたおませな子を\n表現したプリンなの。あえて\n甘さ控えめなの。カラメルは\n後乗せできるから安心するの", "立派なレディ、なの！", "ミヤコはプリンならどんなもの\nでも食べるの。でもカラメルを\nちょっとだけ足すの。\nちょっとだけなら…", 3, 158, "ミサキのプリン", 59, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("謎に包まれたプリンができたの\n何か隠してるようなの…\nこれは危険なプリンなの！", "プリンを持ってこないと\nお仕置きだよ～☆なの！", "味はすごいゴージャスなの！\nボスの風格があるの！\nビッグなミヤコに\nプリンを捧げるの！", 3, 159, "ホマレのプリン", 60, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("ワイルドな見た目なの！\nこれは期待できそうなの。\nきっと躍動感あふれる味なの！", "たぎってきたの！", "最初の一口目が\nすごいインパクトなの！\n無性にケンカしたくなるの！\nプリンをよこせなの！", 3, 160, "カヤのプリン", 61, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("なんか見た目がパッとしないの\nこれほんとに大丈夫なの？\nなんか頼りないの…", "下剋上、やってやるですなの！", "見た目はアレだけど味はおいし\nいの…あと主張もはっきりして\nるの！やる気と自信だけは\n出てきたのうおおおーなの！", 3, 161, "イノリのプリン", 62, 0, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("天下の大悪党のプリンなの\nこれまでのジョーシキに\n捉われないプリンを\n作ってみたの～", "どけどけ～！なの～！", "むむむ…食べたら\nやる気が湧いてきたの！\nミヤコを邪魔するやつはみんな\nまとめてぶっ飛ばしてやるの～", 3, 162, "ムイミのプリン", 63, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("いろんなものに変身したり\n分身したりできるヤツの\nプリンなの。型で同じプリンを\nたくさんたくさん作ったの", "ミラーミラー！なの！", "いつのまにか作ったの全部\n食べちゃったの。なんで\nプリンは分身しないの？\n無限に増えろなの！", 3, 163, "ネネカのプリン", 64, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("金の亡者のプリンなの\n金にものを言わせて作って\nみたの。おばあちゃんの\nプリンと対極なの", "プリンに忠誠を誓いますわ！\nなの！", "むぅ…認めたくないけど\nおいしいの…これを何個も\n作れるほどのお金を稼ぐのは\n大変なの…でもおいしいから…", 3, 164, "クレジッタのプリン", 65, 1, 5);
INSERT INTO `v1_32d50b6548d185ae036a9e5b3f38aeb863ab0e1f76fd2280871d7b1c4b419b47` VALUES ("みんなお世話になるギルド\n管理協会職員のプリンなの\nお役所感を出すために手堅く\n王道に作ったの", "ギルド管理協会へようこそ！\nなの！", "手堅い…！手堅いの…！\n隙のないプリンなの！\n今のミヤコなら完璧な\n書類作成ができそうなの！", 3, 165, "カリンのプリン", 66, 1, 5);
